import React, { useState }  from "react"
import Result from "./result"
const Search = ()=>{
    const [img ,Setimg] = useState();
   function Inp(e){
       Setimg(e.target.value)
   }
  return(
      <> 

        <div>
        <input 
        type="text"
         placeholder="search"
         value={img}
         onChange={Inp}
          />
          <Result name={img}/>
        </div>   


      </>
  )

}

export default Search;
